import React from 'react';

const Itemcard=(props)=>{
    return (
        
<div className="col-11 col-md-6 col-lg-3 mx-0 mb-4" style={{width:'300px'}}>
<div class="card-header">
    Featured
  </div>
            <div className="card p-0 overflow-hidden h-100 shadow">
  <img className="card-img-top img-fluid" src={props.img} />
  <div className="card-body" >
    <h5 className="card-title" style={{align:"left"}}>{props.title}</h5>
    <p className="card-title" style={{align:"left"}}>{props.desc1}</p>
    <p className="card-text" style={{align:"left"}}>{props.desc2}</p>
    <p className="card-text" style={{align:"left"}}>{props.desc3}</p><p className="card-text">{props.desc4}</p>
      </div>
   {/*
    <button className="btn btn-primary">{props.button}</button>*/}
    <div className="card-footer text-muted" align="right">
    2 days ago
  </div>

</div>
        </div>
        

    );
};
export default Itemcard;
